import axios from "axios";
import React from "react";
import { useState } from "react";

const AddSsd = () => {
  const [brand, setBrand] = useState("");
  const [model, setModel] = useState("");
  const [serialNumber, setSerialNumber] = useState("");
  const [size, setSize] = useState("");
  const [purchaseDate, setPurchaseDate] = useState("");
  const [purchasePrice, setPurchasePrice] = useState("");
  const [arrivalDate, setArrivalDate] = useState("");
  const [saleValue, setSaleValue] = useState("");

  // const [productCategory, setProductCategory] = useState("")
  const [file, setFile] = useState("");

  const handleImage = (e) => {
    console.log(e.target.files);
    setFile(e.target.files[0]);
  };

  // const handleChange = (e) => {
  //   setSsd({
  //     ...ssd,
  //     [e.target.brand]: e.target.value,
  //     [e.target.model]: e.target.value,
  //     // [e.target.serialNumber]: e.target.value,
  //     // [e.target.size]: e.target.value,
  //     // [e.target.purchaseDate]: e.target.value,
  //     // [e.target.purchasePrice]: e.target.value,
  //     // [e.target.arrivalDate]: e.target.value,
  //     // [e.target.saleValue]: e.target.value,
  //   });
  // }

  const handleSubmit = async (e) => {
    e.preventDefault();

    // const category = {
    //   productCategory,
    // };

    const formData = new FormData();

    formData.append("file", file);

    // formData.append("ssd", ssd);
    // formData.append("model", ssd.model);
    // formData.append("serialNumber", ssd.serialNumber);
    // formData.append("size", ssd.size);
    // formData.append("purchaseDate", ssd.purchaseDate);
    // formData.append("purchasePrice", ssd.purchasePrice);
    // formData.append("arrivalDate", ssd.arrivalDate);
    // formData.append("saleValue", ssd.saleValue);
    const ssd = {
      brand,
      model,
      serialNumber,
      size,
      purchaseDate,
      purchasePrice,
      arrivalDate,
      saleValue,
    };
    console.log(ssd);
    try {
      const response = await axios({
        method: "POST",
        url: "http://localhost:9090/ssd/new",
        data: formData,

        headers: { "Content-Type": "multipart/form-data" },
      });
      console.log(response.data);
    } catch (error) {
      console.log(error.response);
    }
  };

  return (
    <div className="meuForm">
      <div className="form-row">
        <form onSubmit={(e) => handleSubmit(e)}>
          <div className="col-md-6 offset-md-3">
            <input type="file" name="file" onChange={handleImage} />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"brand"}
              name="brand"
              value={brand}
              className="form-control"
              placeholder="Brand"
              // onChange={handleChange}
              onChange={(e) => setBrand(e.target.value)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"model"}
              name="model"
              className="form-control"
              value={model}
              placeholder="Model"
              onChange={(e) => setModel(e.target.value)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"serialNumber"}
              name="serialNumber"
              className="form-control"
              value={serialNumber}
              placeholder="Serial Number"
              onChange={(e) => setSerialNumber(e.target.value)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"size"}
              name="size"
              className="form-control"
              value={size}
              placeholder="Size"
              onChange={(e) => setSize(e.target.value)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"purchaseDate"}
              name="purchaseDate"
              className="form-control"
              value={purchaseDate}
              placeholder="Purcase date"
              onChange={(e) => setPurchaseDate(e.target.value)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"purchasePrice"}
              name="purchasePrice"
              className="form-control"
              value={purchasePrice}
              placeholder="Purchase price"
              onChange={(e) => setPurchasePrice(e.target.value)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"arrivalDate"}
              name="arrivalDate"
              className="form-control"
              value={arrivalDate}
              placeholder="Arrival date"
              onChange={(e) => setArrivalDate(e.target.value)}
            />
          </div>
          {/* <div className="col-md-6 offset-md-3">
            <input
              type={"productCategory"}
              name="productCategory"
              className="form-control"
              value={productCategory}
              placeholder="Product category"
              onChange={(e) => setProductCategory(e.target.value)}
            />
          </div> */}
          <div>
            <input
              type={"saleValue"}
              name="saleValue"
              value={saleValue}
              className="form-control"
              placeholder="saleValue"
              onChange={(e) => setSaleValue(e.target.value)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <button
              type="submit"
              className="btn btn-success"
              // onChange={(e) => this.handleSubmit(e)}
            >
              Salvar
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};
export default AddSsd;
